      .then(res => {
        const systems = res.data.results[0];
        this.setState({systems});
        console.log(this.state)
      })
  }

  render() {
    return (
        <div>
    <p>Works</p>
      <p>
        {/* { this.state.systems.map(system => <li>{system}</li>)} */}
        {this.state.systems.name.first} 
      </p>
      </div>
    )
  }
}
